import React, {useState, useEffect} from "react";
import {Link} from "react-router-dom";
import SearchBar from "../SearchBar";
import {useTranslation} from "react-i18next";

const Orders = (props) => {
    const [offers, setOffers] = useState([]);
    const [translate, i18n] = useTranslation("global");
    const [searched, setSearched] = useState('');

    useEffect(() => {
        fetch("http://localhost:3001/getBrandOrders/"+ props.user.id)
            .then(res => res.json())
            .then(data => {
                setOffers(data
                    .filter(o => o.name.includes(searched))
                )
            })
            .catch(err => alert(translate("operation_unsuccessful")));
    }, []);

    const deleteOffer = (offerId) => {
        if (window.confirm(translate("offer_delete_confirm")) === true) {
            fetch("http://localhost:3001/deleteProduct/" + offerId, {method: "DELETE"})
                .catch(err => alert(translate("operation_unsuccessful")));
        }
    }

    const offerList = offers.map((offer) => {
        return (
            <tbody key={offer.id}>
            <tr>
                <th>{offer.id}</th>
                <td>{offer.name}</td>
                <td>{offer.surname}</td>
                <td>{offer.size}</td>
                <td>{offer.price}</td>
                <td>{offer.address}</td>
                <td>{offer.status}</td>
                <td>{offer.Product.id}</td>
                <td>{offer.Product.name}</td>
                <td><Link to={offer.id + "/"}>{translate("edit")}</Link></td>
                <td><a onClick={() => deleteOffer(offer.id)} className="underlined">{translate("delete")}</a></td>
            </tr>
            </tbody>
        );
    });

    return (
        <div className="center container">
            <h1>{translate("offers")}</h1>
            <SearchBar setSearched={setSearched}/><br/>
            <Link to="new">{translate("add_offer")}</Link><br/>
            <table>
                <thead>
                <tr>
                    <th>id</th>
                    <th>{translate("name")}</th>
                    <th>{translate("surname")}</th>
                    <th>{translate("size")}</th>
                    <th>{translate("price")}</th>
                    <th>{translate("address")}</th>
                    <th>{translate("status")}</th>
                    <th>{translate("product_id")}</th>
                    <th>{translate("product_name")}</th>
                    <th>{translate("edit_status")}</th>
                    <th>{translate("delete_order")}</th>
                </tr>
                </thead>
                {offerList}
            </table>
        </div>
    );
};

export default Orders;
